import React from "react";
import "./Body.css";

function Body({title, description }) {
	return (
		<div className="box">
			<div className="box-text">
				<h4>{title}</h4>
				<p>{description}</p>
			</div>
			<a></a>
		</div>
	);
}

export default Body;
